bodyparts:
- Nose
- Left_eye
- Right_eye
- Head
- Neck
- Left_shoulder
- Left_elbow
- Left_wrist
- Right_shoulder
- Right_elbow
- Right_wrist
- Hip
- Left_knee
- Left_ankle
- Right_knee
- Right_ankle
- Tail

    # Fraction of video to start/stop when extracting frames for labeling/refinement

    # Fraction of video to start/stop when extracting frames for labeling/refinement

    # Fraction of video to start/stop when extracting frames for labeling/refinement
start: 0
stop: 1
numframes2pick: 20

    # Plotting configuration
skeleton: [[Nose, Left_eye, Right_eye, Head, Neck], [Left_shoulder, Left_elbow, Left_wrist],
  [Right_shoulder, Right_elbow, Right_wrist], [Hip], [Left_knee, Left_ankle], [Right_knee,
    Right_ankle], [Tail]]
skeleton_color: black
pcutoff: 0.6
dotsize: 12
alphavalue: 0.7
colormap: rainbow

    # Training,Evaluation and Analysis configuration
TrainingFraction:
- 0.95
iteration: 0
default_net_type: resnet_50
default_augmenter: default
snapshotindex: -1
batch_size: 8

    # Cropping Parameters (for analysis and outlier frame detection)
cropping: false
    #if cropping is true for analysis, then set the values here:
x1: 0
x2: 640
y1: 277
y2: 624

    # Refinement configuration (parameters from annotation dataset configuration also relevant in this stage)
corner2move2:
- 50
- 50
move2corner: true
